import React from 'react';
import './drumpad.css';

class Drumpad extends React.Component {
    render() {
        return (
            <div id="display">
                <div className="drum-pad" id="q">Q</div>
                <div className="drum-pad" id="w">W</div>
                <div className="drum-pad" id="e">E</div>
                <div className="drum-pad" id="a">A</div>
                <div className="drum-pad" id="">S</div>
                <div className="drum-pad">D</div>
                <div className="drum-pad">Z</div>
                <div className="drum-pad">X</div>
                <div className="drum-pad">C</div>
            </div>
        )
    }
}

export default Drumpad
